        </br>
            {ChrisNumControl2},<br>
        </br>
            {ChrisFechaReg.toString()},<br>
        </br>
            {ChrisExperiencia},<br>
        </br>
            {(ChrisActivo) ? 'Activo' : 'No Activo'}
        </>
    )
}
